  false,\n\t\"url\": null,\n\t\"notes\": \"This document establishes a Fire Management
  Plan for Presquile National Wildlife Refuge.  It relates to existing land management
  policy, however, comprehensive resource plans, such as a Habitat Management Plan
  or Comprehensive Conservation Plan are not yet developed for Presquile NWR. This
  plan will assist in achieving overall management objectives in the interim, as planning
  documents, such as a Comprehensive Conservation Plan, are developed. Protection
  of life, property and natural resources from the harmful and unwanted effects of
  wild land fire remains the priority of this plan; however, this plan has been developed
  to provide direction and continuity in establishing operational procedures to guide
  all fire management activities, in addition to fire suppression.\",\n\t\"license_title\":
